import{ React,useState, useEffect} from 'react'
import CardList from "../CardList";
import axios from 'axios';
import properties from '../../properties'


 const PropertyList = () => {
     const [fetchProperties, setFetchProperties] = useState([]);


     useEffect(() => {
        getData();

     }, [])

    async function getData(fetch) {
        const propertiesResult = await axios.get(properties.properties_list_url);
        console.log(propertiesResult);
        setFetchProperties(propertiesResult.data.data);
    }
    return (
        <div>

             <h1>Property list</h1>


                    {
                        fetchProperties.map((property,index)=>{
                            return (

                                <CardList
                                    id={index + 1}
                                    city={property.city}
                                    location={property.location}
                                    purpus={property.reason}
                                    total_price={property.total_price}
                                    per_sqt_ft={property.per_square_fit}
                                    type={property.type}
                                    bedroom={property.bedroom}
                                    bathroom={property.bathroom}
                                    balcony={property.balcony}
                                    images={property.images}
                                />

                        )})
                    }

        </div>
    )
}


export default  PropertyList
